import React from 'react';
import Modal from '../../UI/Modal';
import './cartItem.css';

const CartItem = () => {
const cartItem = <ul> {[{
    brand : 'WROGN',
    Id:'p14',
    category:'tees',
    detail :'Mens Green Slim Fit Printed T-shirt',
    price:900,
},
].map((item) => <li>{item.brand}</li>)}</ul>

    return(
        <React.Fragment>
            <Modal>
                {cartItem}
                <div><span className="amount">Amount</span></div>
                <div><span className="price">5rs</span></div>
                <div>
                    <button className="closeBtn">Close</button>
                    <button className="orderBtn">Order</button>
                </div>
            </Modal>
        </React.Fragment>
    )
}
export default CartItem;
